import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';

export const ContainerDetails = () => {
  const { id } = useParams();
  const [containerDetails, setContainerDetails] = useState(null);

  useEffect(() => {
    const fetchDetails = async () => {
      const details = await fetchContainerDetails(id);
      setContainerDetails(details);
    };

    fetchDetails();
  }, [id]);

  if (!containerDetails) {
    return <div>Loading...</div>;
  }

  return (
    <div>
      <h1>{containerDetails.name}</h1>
      <p>IP: {containerDetails.ip}</p>
      <p>Port: {containerDetails.port}</p>
      <p>Status: {containerDetails.status}</p>
    </div>
  );
};
